import React from 'react';

function Appclass({ address }) {
  /* const { name, age, phone } = {
    name: '홍길동',
    age: 23,
    phone: '010-2323-2323',
  }; */
  const data = { name: '홍길동', age: 23, phone: '010-2323-2323' };
  return (
    <div>
      <h3>이름 : {data.name}</h3>
      <h3>나이 : {data.age}</h3>
      <h3>전화 : {data.phone}</h3>
    </div>
  );
}

export default Appclass;
